import { NgModule } from "@angular/core";
import { BrowserModule } from "@angular/platform-browser";
import {HttpClientModule}from '@angular/common/http'
import { FormsModule } from '@angular/forms';
import { ReactiveFormsModule } from "@angular/forms";
import { SAvgService } from "src/app/modules/students/sAvgService.service";
import { StudentsListComponent } from "./students-list/students-list.component";
import { SingleStudentDetailsComponent } from "./single-student-details/single-student-details.component";
import { studentService } from "./studentService.service";
import { AppComponent } from "src/app/app.component";
import { SumDaysH } from "./sumDaysH.service";
import { TestComponent } from "./test/test.component";
import { AppRoutingModule } from "src/app/app-routing.module";
import { HomeComponent } from "src/app/home/home.component";
import { NotFoundComponent } from "src/app/not-found/not-found.component";

@NgModule(
    {declarations:[ SingleStudentDetailsComponent, TestComponent,StudentsListComponent, HomeComponent, NotFoundComponent],
    imports:[BrowserModule,FormsModule,ReactiveFormsModule,HttpClientModule,AppRoutingModule],
    bootstrap:[AppComponent],
    providers:[studentService,SAvgService,SumDaysH]
})

export class StudentModule{

}
